import React from "react";
import "../stylesheets/Header.scss";

const Header = () => {
  return (
    <div className="header--wrapper">
      <div className="header--frame">
        <div className="header--ahoi">
          <p className="header--ahoi_A">A</p>
          <p className="header--ahoi_H">h</p>
          <p className="header--ahoi_O">o</p>
          <p className="header--ahoi_I">i</p>
        </div>
      </div>
    </div>
  );
};

export default Header;
